import React from 'react';
import ReactDOM from 'react-dom' ;
import './index.css' ;
import Card from './Cards' ;
import Sdata from './Sdata' ;


console.log(Sdata[0]) ;


ReactDOM.render(
  <>
    <h1 className = 'heading_style'> List of top 5 Netflix movies in 2k23</h1>
    <Card 
    imgSrc = {Sdata[0].imgSrc}
    title =  {Sdata[0].title}
    sname =  {Sdata[0].sname}
    link =   {Sdata[0].link}
    />

    <Card 
    imgSrc = {Sdata[1].imgSrc}
    title =  {Sdata[1].title}
    sname =  {Sdata[1].sname}
    link =   {Sdata[1].link}
    />

    <Card 
    imgSrc = {Sdata[2].imgSrc}
    title =  {Sdata[2].title}
    sname =  {Sdata[2].sname}
    link =   {Sdata[2].link}
    />

  </>


  ,document.getElementById('root') 
)
